import math

def get_weight(piece):
    if piece == 'Q':
        return 9
    elif piece == 'R':
        return 5
    elif piece == 'B':
        return 3
    elif piece == 'N':
        return 3
    elif piece == 'P':
        return 1
    elif piece == 'K':
        return 0
    else:
        return 0

def get_position_weight(board):
    white_weight = 0
    black_weight = 0
    for i in range(8):
        for j in range(8):
            if board[i][j] != '.':
                white_weight += get_weight(board[i][j].upper())
                black_weight += get_weight(board[i][j].lower())
    return white_weight, black_weight

if __name__ == '__main__':
    board = []
    for _ in range(8):
        board.append(input())
    white_weight, black_weight = get_position_weight(board)
    if white_weight > black_weight:
        print('White')
    elif black_weight > white_weight:
        print('Black')
    else:
        print('Draw')

